import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import NavbarBasic from './Components/NavbarBasic';
import Curriculum from './Components/CurriculumEN';
import { Routes, Route, Link } from "react-router-dom";

function App() {
  return (
    <div className='App'>
      <h1>Hi</h1>
      <Routes>
        <Route path="/" element={<Home />} />
      </Routes>
      <NavbarBasic />
      <Curriculum />
    </div>
  );
}

function Home () {
  return (
    <>
      <NavbarBasic />
      <Curriculum />
    </>
  )
}

export default App;
